INSERT INTO `cards` VALUES (1,'#60cd4f','2022-01-16','The alarm went off at exactly 6:00 AM as it had every morning for the past five years. Barbara began her morning and was ready to eat breakfast by 7:00 AM. The day appeared to be as normal as any other, but that was about to change. In fact, it was going to change at exactly 7:23 AM.','absence short an','afilkin2n@cnn.com',0),(2,'#d66461','2017-04-29','I checked in for the night at Out O The Way motel. What a bad choice that was. First I took a shower and a spider crawled out of the drain. Next, the towel rack fell down when I reached for the one small bath towel. This allowed the towel to fall halfway into the toilet. I tried to watch a movie, but the remote control was sticky and wouldn’t stop scrolling through the channels. I gave up for the night and crawled into bed. I stretched out my leg and felt something furry by my foot. Filled with fear, I reached down and to my surprise, I pulled out a raccoon skin pair of underwear. After my initial relief that it wasn’t alive, the image of a fat, ugly businessman wearing raccoon skin briefs filled my brain. I jumped out of the bed, threw my toothbrush into my bag, and sprinted towards my car.','hall sampling accommodations','wscoular21@elpais.com',0),(3,'#dd722a','2015-02-09','There was something beautiful in his hate. It wasn\'t the hate itself as it was a disgusting display of racism and intolerance. It was what propelled the hate and the fact that although he had this hate, he didn\'t understand where it came from. It was at that moment that she realized that there was hope in changing him.','column improvements read','rbax1k@xinhuanet.com',2),(5,'#55f3fe','2021-01-01','They rushed out the door, grabbing anything and everything they could think of they might need. There was no time to double-check to make sure they weren\'t leaving something important behind. Everything was thrown into the car and they sped off. Thirty minutes later they were safe and that was when it dawned on them that they had forgotten the most important thing of all.','players knew payday','kdongles2f@engadget.com',1),(6,'#032e42','2017-02-15','The thing that\'s great about this job is the time sourcing the items involves no traveling. I just look online to buy it. It\'s really as simple as that. While everyone else is searching for what they can sell, I sit in front of my computer and buy better stuff for less money and spend a fraction of the time doing it.','consideration hunting parents','wscoular21@elpais.com',0),(7,'#165855','2016-10-11','I love the feel of wood curls flying off the lathe as I begin to shape the log in front of me. The sound of scraping changes based on the wetness of the wood, the speed at which the lathe is turning, and the type of cut I am making. The smell and feel of wet wood being turned are unique. The water is sprayed out as I cut through the different layers of wood. A log can turn into anything one\'s imagination can think of with the right set of hands-on tools. I have those hands and imagination. I use all of my senses and intuition to create a beautiful object. That is why I enjoy turning wood.','photographer national medicare','cguilliatt1n@google.ca',0),(8,'#826b6f','2022-08-17','The choice was red, green, or blue. It didn\'t seem like an important choice when he was making it, but it was a choice nonetheless. Had he known the consequences at that time, he would likely have considered the choice a bit longer. In the end, he didn\'t and ended up choosing blue.','contrast walking mysql','whudel2p@opensource.org',2),(9,'#a9ee63','2018-05-08','One can cook on and with an open fire. These are some of the ways to cook with fire outside. Cooking meat using a spit is a great way to evenly cook meat. In order to keep meat from burning, it\'s best to slowly rotate it. Hot stones can be used to toast bread. Coals are hot and can bring things to a boil quickly. If one is very adventurous, one can make a hole in the ground, fill it with coals and place foil-covered meat, veggies, and potatoes into the coals, and cover all of it with dirt. In a short period of time, the food will be baked. Campfire cooking can be done in many ways.','cam objects francisco','tmcall2a@seesaa.net',0),(10,'#434db8','2017-04-10','By six children in tow, Catherine raced to the airport departing gate. This wasn\'t an easy task as the children had other priorities than to get to the gate. She knew that she was tight on time and the frustration came out as she yelled at the kids to keep up. They continued to test her, pretending not to listen and to move in directions that only slowed them down. They had no idea the wrath they were about to receive when Catherine made it to the gate only to be informed that they had all missed the plane.','everything end constitutes','aruberti1x@reddit.com',0),(11,'#435d22','2015-05-31','It had been her dream for years but Dana had failed to take any action toward making it come true. There had always been a good excuse to delay or prioritize another project. As she woke, she realized she was once again at a crossroads. Would it be another excuse or would she finally find the courage to pursue her dream? Dana rose and took her first step.','notification sri module','bdalliwater2@diigo.com',1),(12,'#b9e493','2018-11-06','By six children in tow, Catherine raced to the airport departing gate. This wasn\'t an easy task as the children had other priorities than to get to the gate. She knew that she was tight on time and the frustration came out as she yelled at the kids to keep up. They continued to test her, pretending not to listen and to move in directions that only slowed them down. They had no idea the wrath they were about to receive when Catherine made it to the gate only to be informed that they had all missed the plane.','meal survey expanded','hgrummitt13@etsy.com',1),(13,'#f8216d','2018-12-19','The alarm went off at exactly 6:00 AM as it had every morning for the past five years. Barbara began her morning and was ready to eat breakfast by 7:00 AM. The day appeared to be as normal as any other, but that was about to change. In fact, it was going to change at exactly 7:23 AM.','jp him during','vgollint@trellian.com',1),(14,'#f210ca','2016-10-11','This is important to remember. Love isn\'t like pie. You don\'t need to divide it among all your friends and loved ones. No matter how much love you give, you can always give more. It doesn\'t run out, so don\'t try to hold back giving it as if it may one day run out. Give it freely and as much as you want.','labor songs physician','rsnarrf@sciencedirect.com',1),(15,'#b379be','2018-05-26','There was no ring on his finger. That was a good sign although far from proof that he was available. Still, it was much better than if he had been wearing a wedding ring on his hand. She glanced at his hand a bit more intently to see if there were any tan lines where a ring may have been, and he\'s simply taken it off. She couldn\'t detect any which was also a good sign and a relief. The next step would be to get access to his wallet to see if there were any family photos in it.','spectacular supplements stated','cbickleh@mlb.com',2),(17,'#973043','2018-01-16','I love the feel of wood curls flying off the lathe as I begin to shape the log in front of me. The sound of scraping changes based on the wetness of the wood, the speed at which the lathe is turning, and the type of cut I am making. The smell and feel of wet wood being turned are unique. The water is sprayed out as I cut through the different layers of wood. A log can turn into anything one\'s imagination can think of with the right set of hands-on tools. I have those hands and imagination. I use all of my senses and intuition to create a beautiful object. That is why I enjoy turning wood.','seconds log lower','nhugnin2q@nydailynews.com',2),(18,'#6e1d42','2019-02-05','The leather jacked showed the scars of being his favorite for years. It wore those scars with pride, feeling that they enhanced his presence rather than diminishing it. The scars gave it character and had not overwhelmed to the point that it had become ratty. The jacket was in its prime and it knew it.','english writer lol','tgoddard1r@sogou.com',0),(19,'#180b17','2018-04-28','There was a time when he would have embraced the change that was coming. In his youth, he sought adventure and the unknown, but that had been years ago. He wished he could go back and learn to find the excitement that came with change but it was useless. That curiosity had long left him to where he had come to loathe anything that put him out of his comfort zone.','folks shows refund','mbenetk@g.co',0),(20,'#ed2cfe','2017-01-15','\'So, what do you think?\' he asked nervously. He wanted to know the answer, but at the same time, he didn\'t. He\'d put his heart and soul into the project and he wasn\'t sure he\'d be able to recover if they didn\'t like what he produced. The silence from the others in the room seemed to last a lifetime even though it had only been a moment since he asked the question. \'So, what do you think?\' he asked again.','study notebook roads','gwiddowsa@earthlink.net',1),(21,'#5c2229','2022-04-05','Time is all relative based on age and experience. When you are a child an hour is a long time to wait but a very short time when that’s all the time you are allowed on your iPad. As a teenager time goes faster the more deadlines you have and the more you procrastinate. As a young adult, you think you have forever to live and don’t appreciate the time you spend with others. As a middle-aged adult, time flies by as you watch your children grow up. And finally, as you get old and you have fewer responsibilities and fewer demands on you, time slows. You appreciate each day and are thankful you are alive. An hour is the same amount of time for everyone yet it can feel so different in how it goes by.','like unique headset','igladwish26@qq.com',1),(22,'#a8dab9','2016-01-0